import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { useFormik } from 'formik';
import { useAuthStore } from '../store/store';
import Navbar from '../components/Nav';
import toast, { Toaster } from "react-hot-toast";
import { IoIosSearch } from "react-icons/io";
import { FaTimes } from 'react-icons/fa';

export default function Admin() {
  const navigate = useNavigate();
  const [searchTerm, setSearchTerm] = useState('');
  const [filterValue, setFilterValue] = useState('');
  const [items, setItems] = useState([]);

  const handleSearch = (event) => {
    setSearchTerm(event.target.value);
  };

  const handleClearSearch = () => {
    setSearchTerm('');
  };

  const handleFilter = (event) => {
    setFilterValue(event.target.value);
  };

  const handleAddItem = () => {
  };
    // <h1 className='px-8 py-2 text-3xl font-bold tracking-wider'>BEARBRICK Database</h1>
  return (
    <main>
      <Navbar />
      
      {/* <hr class="h-px my-8 bg-gray-200 border-0 dark:bg-gray-400"></hr> */}
      <div className="container mx-auto">
            <Toaster position="top-center" reverseOrder={false}></Toaster>
            <div className="flex flex-col justify-center items-center">
                <h1 className='flex justify-start items-center text-3xl font-bold tracking-wider'
                >BEARBRICK Database</h1>

                <div className="flex flex-row justify-start items-center">
                    <input
                    type="text"
                    placeholder="Search"
                    value={searchTerm}
                    onChange={handleSearch}
                    className="w-4/5 h-12 pl-10 pr-32 border border-gray-400 rounded-xl focus:outline-none focus:ring- focus:ring-gray-400 focus:border-transparent"
                    />

                    <IoIosSearch className="relative top-4 left-3 text-gray-500" />
                    {searchTerm && (
                        <button
                        className="absolutetop-4 right-6 text-gray-400"
                        onClick={handleClearSearch}
                        >
                        <FaTimes />
                        </button>
                    )}

                    <button
                    onClick={handleAddItem}
                    className="w-28 h-12 bg-white text-black px-4 py-2 rounded-xl ml-2"
                    >
                    Add Item
                    </button>
                </div>
            </div>
      </div>
      
        
      {/* <ul>
        {items.map((item) => (
          <li key={item.id}>{item.name}</li>
        ))}
      </ul> */}
    </main>
  );
}
